import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import LandingPage from './components/LandingPage';
import Login from './components/Login';
import Signup from './components/Signup';
import Exam from './components/Exam';
import ExamResult from './components/ExamResult';
import Courses from './components/Courses';
import CrearCurso from './components/CrearCurso';
import CursoDetalle from './components/CursoDetalle';
import EditarCurso from './components/EditarCurso'; // Importar el componente EditarCurso
import Examen from './components/Examen';
import Evaluacion from './components/Evaluacion';
import Evaluaciones from './components/Evaluaciones';
import { AuthProvider } from './context/AuthContext';
import Notas from './components/Notas';
import './App.css';

function App() {
  const usuarioId = 1;

  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Header />
          <main>
            <Routes>
              <Route path="/" element={<LandingPage />} />
              <Route path="/login" element={<Login />} />
              <Route path="/signup" element={<Signup />} />
              <Route path="/exam" element={<Exam />} />
              <Route path="/exam-result" element={<ExamResult />} />
              <Route path="/courses" element={<Courses />} />
              <Route path="/crearcurso" element={<CrearCurso />} />
              <Route path="/curso/:id" element={<CursoDetalle />} />
              <Route path="/evaluacion/:evaluacionId" element={<Evaluacion />} />
              <Route path="/examen/:id" element={<Examen />} />
              <Route path="/courses/:cursoId/evaluaciones" element={<Evaluaciones />} />
              <Route path="/mis-evaluaciones" element={<Notas usuarioId={usuarioId} />} />

              {/* Nueva ruta para editar curso */}
              <Route path="/editar-curso/:id" element={<EditarCurso />} /> 
            </Routes>
          </main>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
